import api from "./baseApi";

export const adminApi = {
  getAdmins(params, cancelToken) {
    return api.get("/api/admin", { params, cancelToken });
  },
  getAdmin(params) {
    return api.get(`api/admin/${params.id}`, { params });
  },
  putAdmin(params) {
    return api.get(`api/admin/${params.id}`, params);
  },
  postAdmin(params) {
    return api.post("api/admin", params);
  },
  postRideResultCsv(params) {
    return api.post("api/admin/ride-result/csv", params);
  },
  deleteAdmin(params) {
    return api.delete(`api/admin/${params.id}`);
  },
};
